import React from "react";
import "../../css/buttonsStyle/buttonThree.css";

const ButtonThree = () => {
  return (
    <div className="btnThreeFlexContainer">
      <div>
        <div className="bThreeSprite1"></div>
        <div className="bThreeSprite2"></div>
      </div>
    </div>
  );
};

export default ButtonThree;
